import * as React from "react";
import { Grid, Card, CardMedia, CardContent, Typography, Container, ImageList, ImageListItem} from '@mui/material';
import './Result.css';

export const Result = () => {
    return (
        <Container maxWidth="sm">
            <Grid spacing={4}>
                <ImageList 
                    sx={{ width:500,height:450}} 
                    cols ={5}
                    rowHeight={164}               
                >
                {
                    itemData.map(item => (
                        <ImageListItem key={item.img}>
                            <img 
                                src={`&{item.img}?w164h164fit=crop&auto=format&dpr=2`} 
                                alt={item.title} loading='lazy'
                            />
                        </ImageListItem>
                    ))
                }
                
                </ImageList>
            </Grid>
        </Container>
    )
};

const itemData = [
    {
        img: 'https://unsplash.com/photos/a-man-is-walking-through-a-narrow-canyon-9Jgo0Ix_TRw',
        title: 'A guy'
    }
]

export default Result;
